import React from 'react'
import { Icon } from '@iconify/react';
import '.'

function SideBar() {
  return (
    <div>
        <div className="logo-school-name">
            <Icon icon="cil:badge" />
            <span>School Space</span>
        </div>
    </div>
  )
}

export default SideBar
